import React from 'react';

interface State {
  text: any;
}

class Form extends React.Component<State> {
  constructor(props: any) {
    super(props);
    this.state = {
      text: '',
    };
  }

  // state: State = {
  //   input: '',
  // };

  render() {
    return (
      <form>
        <input
          type="text"
          value={this.state.text}
        />
        <button>登録</button>
      </form>
    );
  }

}

export default Form;
